//VERSION DEL SCRIPT

var version = "0.7.8.1";	//Version of the script. For checking for updates
var update;				//Variable for storing the result of checking for updates
var plusPlayer = false;	//Variable to store if we are plusPlayer
var get;				//To store the get function

//Function get (it gets data from other web)
//url--> url of the web
//func--> function to do with the received data

try{
	//Try to assign GM_xmlhttpRequest to get function (firefox and emulated greasemonkey). It can do cross domain!
	get = function(url, func) {
	  GM_xmlhttpRequest({
		method: "GET",
		 url: url,
		 onload: function(xhr) { func(xhr.responseText); }
	  });
	}
}
catch( ex ){
	//If we cant with GM_xmlhttpRequest, assign general request (it cant do cross domain...)
	get = function(url, func) {
		var xhr = new XMLHttpRequest();
		xhr.open("GET", url, true);
		xhr.send();
		xhr.onreadystatechange = function() {
		  if (xhr.readyState == 4) {
			func(xhr.responseText);
		  }
		}
	}
}

function checkUpdate(text) {

	var ini = text.indexOf("<b>Version:</b>");	//Search for number of version ( x.x.x )
	ini += ("<b>Version:</b>").length;
	var end = text.indexOf( "<p/>", ini );

	text = text.substring( ini+1, ini+8 );
	text = text.replace( /\s/g, "" );		//Clear white spaces
	//alert(text);
	if( text.split(".").length < 3 ){	//Error if there are not at least 3 numbers
		update = '<span class="button01">Error al comprobar la versión</span>';
	}
	else if( text == version ){				//Using the newest version
		update = '<span class="button01">Versión actualizada</span>';
	}
	else{	//New update!
		update = '<span class="button01">Versión vieja</span>' +
				 '<a href=# onclick=window.open("http://userscripts.org/scripts/source/142322.user.js")> Actualizar!</a>'	
	}
	
	//Search for status player and change it to SuperPlayer with the number of version of the script
	var span = document.getElementsByTagName("span");
	for( var i=0; i<span.length; i++){

		//plusplayer?
		if (span[i].textContent == "Plus" ){
			plusPlayer = true;
		}
		//or basic?
		if (span[i].textContent == "basic" ){
			span[i].textContent = "SuperPlayer";
			
			//add it!
			span[i+1].innerHTML += '<br/><br/><span class="button01">v' + version + '</span>' + update;
			document.getElementById('kicker').style.width = '300px';
			document.getElementById('kicker').style.marginLeft = '500px';
			break;
		}
	}
}
 get( "http://userscripts.org/scripts/show/142322", checkUpdate );	//Check for updates (Only for function get with cross domain)

 
 
